// React
import {
  createBrowserRouter, 
  createRoutesFromElements,
  Route, 
  RouterProvider
} from 'react-router-dom'
// Layout
import RootLayout from './layout/RootLayout';
// Pages
import Buy from './pages/Buy';
import SalesLayout from './layout/SalesLayout';
import DetailedSales from './pages/DetailedSales';
import SalesSummary from './pages/SalesSummary';
import DiscountedSales from './pages/DiscountedSales';
import SalesReport from './pages/SalesReports';
// // CSS
// import "./css/output.css"


const router = createBrowserRouter(
  createRoutesFromElements(
    <Route path="/" element={<RootLayout />}>
        <Route index element={<Buy />} />
        <Route path='sales' element={<SalesLayout />}>
          <Route index element={<SalesSummary />} />
          <Route path='sales-history' element={<DetailedSales />} />
          <Route path='discounted-sales' element={<DiscountedSales />} />
        </Route>
        <Route path='reports' element={<SalesReporst />} />
  </Route>
  )
)

function App() {
  return (
    <RouterProvider router={router} />
  );
}

export default App;
